import React, { Component } from "react";

class Home extends Component {
  state = {};
  render() {
    return (
      <div className="p-grid p-align-center">
        <div className="p-col">4</div>
        <div className="p-col">4</div>
        <div className="p-col">4</div>
      </div>
    );
  }
}

export default Home;
